- input: "TEXT\x1CC00396655\x1C2\x1C\x1CF3XA\x1C\"This amended report carries forward
    the corrected opening balance carried forward from the previous amended report
    and adds only dividends and $3,353.00 in voided disbursements which were inadvertently
    omitted from the original report and subsequent amendments.  Though not raised
    by the Commission in a Request for Additional Information (RFAI), we have also
    corrected the itemization of a contribution to Trey Martinez Fisher which was
    accidentally disclosed on a Schedule E on the previous Year End filing.  This
    contribution was NOT an independent expenditure on behalf of a Federal candidate.
    \ We have not made any expenditures to influence Federal elections since the 2/16/06
    contribution to Charles Gonzalez.  Please update your records accordingly.\""
